import React from 'react';
import ButtonsHomeView from '../../components/buttons/ButtonsHomeView';
import './HomeView.css';
import { useNavigate } from "react-router-dom";



function HomeView() {
  let navigate = useNavigate(); 
  const routeChange = () =>{ 
    let path = `newPath`; 
    navigate(path);
  }
return (
  <div className='backgroundImage'>
      <div className='Text'>
        <div className='Title'>
          <h1>
            TeamUp
          </h1>
        </div>
        <div className='subtitle'>
          <h3>
            Are you ready for this new experience?
          </h3>
        </div>
        <div className='ContainerButtons'>
          <ButtonsHomeView name='Busco Cancha' onClick={routeChange} />
          <ButtonsHomeView name='Arriendo mi Cancha' onClick={routeChange} />
        </div>
      </div>
    </div>
  )
}

export default HomeView;
